let initialState = {
  "information_announcement": [{
    "infoText": "New Update Available",
    "infoLink": ""
  },
  {
    "infoText": "Apply for Netflix",
    "infoLink": ""
  }, {
    "infoText": "Random Information",
    "infoLink": ""
  }, {
    "infoText": "Random Information",
    "infoLink": ""
  }
  ]
}



let information_announcementDetails = (state = {}, action) => {
  switch (action.type) {
    case "INFORMATION_ANNOUNCEMENT":
      return action.payload;
    default:
      return {};
  }
}

export { information_announcementDetails };
